                font-weight:bold;
                font-size:12px;
            }
            #message {
                color:blue;
                font-weight:bold;
                font-size:12px;
                text-align:center;
            }
            #stack{
                text-align:center;
            }
            legend{
                display:inline-block;
                color:#6d0019;
                font-size:14px;
                font-weight:bold;
                position:relative;
                margin-top:-20px;
            }
        </style>
        <style>
            /**Twitter Bootstrap**/
            .span4 {
                width:320px;
            }
            .plan {
                border-radius: 5px;
                text-align: center;
                background-color: #f3f3f3;
                -moz-box-shadow: 0 0 6px 2px #b0b2ab;
                -webkit-box-shadow: 0 0 6px 2px #b0b2ab;
                box-shadow: 0 0 6px 2px #b0b2ab;
            }
            .plan:hover {
                background-color: #fff;
                -moz-box-shadow: 0 0 12px 3px #b0b2ab;
                -webkit-box-shadow: 0 0 12px 3px #b0b2ab;
                box-shadow: 0 0 12px 3px #b0b2ab;
            }
            .plan {
                
                color: #ababab;
                -moz-border-radius: 5px 5px 0 0;
                -webkit-border-radius: 5px 5px 0 0;
            }
            
            .plan .plan-name span {
                font-size: 20px;
            }
            .plan ul {
                list-style: none;

                padding:0;
                margin: 0 auto;
            }
            .plan ul li.plan-feature:first-of-type {
                border-top:none !important;

            .plan ul li.plan-feature {

    <body>
        <header>
            
        </header>
        <section id="primaryBody">
            <div id="error"></div>
            <br /><br />
            <section id="form">
                <form onsubmit="return false;">
                    <fieldset>
                        <span id="setLogStatus">Persist All Messages On Screen: </span><input style="display:inline-block;width:20px;height:20px;position:relative;top:2px;" type="checkbox" value="off" id="logStatus" />
                    </fieldset>
                    <br /><br />
                    <fieldset>
                        <legend>
                            Create Cache: 
                        </legend>
                        <label for="createCacheSize">Create Cache Size: </label><input type="text" id="createCacheSize"  /><br class="clearBoth" />
                        <label for="cacheEvictionStrategy">Eviction Strategy</label><select id="cacheEvictionStrategy"><option>lru</option><option>random</option></select><br class="clearBoth" />
                        <button id="btnCreateCache">Create Cache</button>
                    </fieldset>
                    <br /><br />
                    <fieldset>
                        <legend>
                            Create Cache Item:
                        </legend>
                        <label for="newCacheItemKey">Key: </label><input type="text" id="newCacheItemKey" data-for="btnNewCacheItem" /><br class="clearBoth" />
                        <label for="newCacheItemValue">Value: </label><input type="text" id="newCacheItemValue" data-for="btnNewCacheItem" /><br class="clearBoth" />
                        <button id="btnNewCacheItem">Create Cache Item</button>
                    </fieldset>
                    <br /><br />
                    <fieldset>
                        <legend>
                            Read Cache Item:
                        </legend>
                        <label for="findCacheItemKey">Key: </label><input type="text" id="findCacheItemKey" data-for="btnFindCacheItem" /><br class="clearBoth" />
                        <button id="btnFindCacheItem">Read Cache Item</button>
                    </fieldset>
                    <br /><br />
                    <fieldset>
                        <legend>
                            Update Cache Item:
                        </legend>
                        <label for="updateCacheItemKey">Key: </label><input type="text" id="updateCacheItemKey" data-for="btnUpdateCacheItem" /><br class="clearBoth" />
                        <label for="updateCacheItemValue">Value: </label><input type="text" id="updateCacheItemValue" data-for="btnUpdateCacheItem" /><br class="clearBoth" />
                        <button id="btnUpdateCacheItem">Update Cache Item</button>
                    </fieldset>
                    <br /><br />
                    <fieldset>
                        <legend>
                            Destroy Cache Item:
                        </legend>
                        <label for="destroyCacheItem">Key: </label><input type="text" id="destroyCacheItemKey" data-for="btnDestroyCacheItem" /><br class="clearBoth" />
                        <button id="btnDestroyCacheItem">Destroy Cache Item</button>
                    </fieldset>
                    <br /><br />
                    <fieldset>
                        <legend>
                            Test Cache Item Existence:
                        </legend>
                        <label for="cacheItemExistsKey">Key: </label><input type="text" id="cacheItemExistsKey" data-for="btnCacheItemExists" /><br class="clearBoth" />
                        <button id="btnCacheItemExists">Test Cache Item Existence</button>
                    </fieldset>
                </form>
            </section>
            <div id="stack">
                <span>Cache Size: </span><span id="stackSize">0</span>&nbsp;&nbsp;&nbsp;&nbsp;<span>Max Cache Size: </span><span id="stackSizeMax">0</span>
                <br />
                <br />
                <div class="span4 plan">
                    <ul id="stackElements">
                        <li class="plan-feature">Stack Empty</li>
                    </ul>
                </div>
                <br />
                <span>Eviction Strategy: </span><span id="evictionStrategy"></span>
                <br /><br />
                
            </div>
            <div id="message"></div>
        </section>
    </body>
